import React from 'react'
import Imagen1 from '../assets/imagen1.jpg';


const Img1 = () => {
  return (
    <div className=' md:w-[100%] w-[100%] pt-5 bg-none mx-auto object-fill '>
    <div className=' max-w-[1240px] mx-auto grid md:grid-cols-2 '></div>
   <img className=' md:w-[100%] w-[100%] h-10' src={Imagen1} alt="/" />

   </div>
  )
}

export default Img1;
